package com.moxtra.cordovaplugin;

public class RumtimeParameters 
{
	private String mFirstName;
	private String mLastName;
	private String mUniqueId;
	private String mMeetId;
	private String mOrgId;
	
	public RumtimeParameters(String mFirstName, String mLastName, String mUniqueId, String mMeetId) 
	{
		super();
		this.mFirstName = mFirstName;
		this.mLastName = mLastName;
		this.mUniqueId = mUniqueId;
		this.mMeetId = mMeetId;
	}
	
	public String getFirstName() 
	{
		return mFirstName;
	}
	public void setFirstName(String mFirstName) 
	{
		this.mFirstName = mFirstName;
	}
	
	public String getLastName() 
	{
		return mLastName;
	}
	public void setLastName(String mLastName) 
	{
		this.mLastName = mLastName;
	}
	
	public String getUniqueId() 
	{
		return mUniqueId;
	}
	public void setUniqueId(String mUniqueId) 
	{
		this.mUniqueId = mUniqueId;
	}
	
	public String getMeetId() 
	{
		return mMeetId;
	}
	public void setMeetId(String mMeetId) 
	{
		this.mMeetId = mMeetId;
	}

	public String getOrgId() {
		return mOrgId;
	}

	public void setOrgId(String mOrgId) {
		this.mOrgId = mOrgId;
	}
	
}
